			padding:"5px",
      marginBottom: "10px",

		}}
		>Add</button>

        <User user_name="Andre Fu" user_port="50000"/>

      </div>

      <ModalInFunctionalComponent></ModalInFunctionalComponent>
    </div>
  );
}

export default App;
